            text.setStroke(textHalo);
          } else {
            text.setStroke(undefined);
          }

          var textPadding = getValue(_layer, 'layout', 'text-padding', zoom, f);
          var padding = text.getPadding();

          if (textPadding !== padding[0]) {
            padding[0] = padding[1] = padding[2] = padding[3] = textPadding;
          }

          style.setZIndex(99999 - index); // style.setZIndex(99999);
        }
      }
    }

    if (stylesLength > -1) {
      styles.length = stylesLength + 1;
      return styles;
    }
  };

  olLayer.setStyle(styleFunction);
  olLayer.set('mapbox-source', mapboxSource);
  olLayer.set('mapbox-layers', mapboxLayers);
  return styleFunction;
}

